import { _Finder } from "../../../stl-cmp";
import search from '../../../img/search.svg';
import { useState } from "react";
import { connect } from "react-redux";

const Finder = () => {
    const [state, setState] = useState({
        search: ''
    })

    const searchChange = ({target: {name, value}})=>{
        setState({
            ...state,
            [name]:value
        })
        search(state[name])
    }

    return (
        <_Finder>
            <form action="">
            <label>
					<p>Busca un Can</p>
					<div>
						<input name='search' onChange={searchChange} type="text" />
						<button>
							<object data={search} type="image/svg+xml" />
						</button>
					</div>
				</label>
            </form>
        </_Finder>
    )
}

export default connect ()(Finder)
